import React from 'react';  
import axios from 'axios'; 

class listaDiretorios extends React.Component {  
    constructor() {  
        super();  
        this.state = {  
            DiretoriosData: []  
        }  
    }  
  
    componentDidMount() {  
        axios.get("http://localhost:49548/api/diretorios").then(response => {  
            //console.log(response.data);  
            const lista1 = response.data;
            this.setState({  
                lista1
            });  
        });  
    }  
  
    render() {  
  
        return (  
            <ul>
            { this.state.lista1.map(lista1 => <li>{lista1.NomeDiretorio}</li>)}
            </ul>
        )  
    }  
}  
  

    export default listaDiretorios;
